import React, {Component} from "react";

class Joke extends Component{
    render(props){
        return(
           <>
           <div Setup = {props.Setup} Punchline = {props.Punchline}></div>
           <div Setup = {props.Setup} Punchline = {props.Punchline}></div>
           <div Setup = {props.Setup} Punchline = {props.Punchline}></div>
           <div Setup = {props.Setup} Punchline = {props.Punchline}></div>
           <div Setup = {props.Setup} Punchline = {props.Punchline}></div>
           </>
        )
    }
}

export default Joke
